def calculate_total(items):
    total = 0
    for item in items:
        if item["active"]:
            total += item["price"]
    return total

class UserManager:
    def __init__(self):
        self.users = []

    def add_user(self, user):
        self.users.append(user)
        return True

    def get_user(self, user_id):
        for user in self.users:
            if user["id"] == user_id:
                return user
        return None

